import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'app-inicio-sesion',
  templateUrl: './inicio-sesion.page.html',
  styleUrls: ['./inicio-sesion.page.scss'],
})
export class InicioSesionPage {
  email: string = '';
  password: string = '';
  errorMessage: string = '';

  constructor(private router: Router) {}

  login() {
    // Verificar si el correo electrónico es válido
    if (!this.isValidEmail(this.email)) {
      this.errorMessage = 'Ingrese un correo electrónico válido.';
      return;
    }

    // Verificar si la contraseña tiene al menos 6 caracteres
    if (this.password.length < 6) {
      this.errorMessage = 'La contraseña debe tener al menos 6 caracteres.';
      return;
    }

    // Si pasa las verificaciones, navegar a la página de inicio
    this.router.navigate(['/info']);
  }

  // Función para verificar si el correo electrónico es válido
  private isValidEmail(email: string): boolean {
    const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
    return emailRegex.test(email);
  }
}
<ion-header [translucent]="true">

</ion-header>

<ion-content [fullscreen]="true">

  <img id="logo" src="assets\imagenes\logo.png" alt="Descripción de la imagen">

  <h1>Iniciar sesión</h1>
 
 
  <ion-content class="ion-padding">
    <div class="login-container">
    <ion-item>
      <ion-label position="floating">Correo Electrónico</ion-label>
      <ion-input type="email" [(ngModel)]="email"></ion-input>
    </ion-item>

    <ion-item>
      <ion-label position="floating">Contraseña</ion-label>
      <ion-input type="password" [(ngModel)]="password" ></ion-input>
    </ion-item>
    <div *ngIf="errorMessage" class="error-message">{{ errorMessage }}</div>

    
    <ion-button (click)="login()" >Iniciar Sesión</ion-button>
  </div>

  <div class="signup-container">
    <p>¿Aún no tienes cuenta?</p>
    <ion-button [routerLink]="['/signup']">Crear una nueva cuenta</ion-button>
  </div>
  
  
  </ion-content> 


  
</ion-content>
